import{_ as e,o as a,c as t,h as o}from"./app.a7cfcdfe.js";const m=JSON.parse('{"title":"Things To Know Before You Start","description":"","frontmatter":{},"headers":[{"level":2,"title":"This page will be an overview of things to know and understand before you start this project","slug":"this-page-will-be-an-overview-of-things-to-know-and-understand-before-you-start-this-project","link":"#this-page-will-be-an-overview-of-things-to-know-and-understand-before-you-start-this-project","children":[{"level":3,"title":"Firmware is not final","slug":"firmware-is-not-final","link":"#firmware-is-not-final","children":[]},{"level":3,"title":"Firmware may have user difficulties","slug":"firmware-may-have-user-difficulties","link":"#firmware-may-have-user-difficulties","children":[]},{"level":3,"title":"Documentation may be incomplete","slug":"documentation-may-be-incomplete","link":"#documentation-may-be-incomplete","children":[]},{"level":3,"title":"Some DIY knowledge is required","slug":"some-diy-knowledge-is-required","link":"#some-diy-knowledge-is-required","children":[]},{"level":3,"title":"Youtubers","slug":"youtubers","link":"#youtubers","children":[]},{"level":3,"title":"Papers and articles","slug":"papers-and-articles","link":"#papers-and-articles","children":[]},{"level":3,"title":"Once you have acknowledged the items above, move on to the Full Build Guide","slug":"once-you-have-acknowledged-the-items-above-move-on-to-the-full-build-guide","link":"#once-you-have-acknowledged-the-items-above-move-on-to-the-full-build-guide","children":[]}]}],"relativePath":"getting_started/things_to_know.md","lastUpdated":1676228286000}'),i={name:"getting_started/things_to_know.md"},r=o('<h1 class="text-[var(--font-accent)]" id="things-to-know-before-you-start" tabindex="-1">Things To Know Before You Start <a class="header-anchor" href="#things-to-know-before-you-start" aria-hidden="true">#</a></h1><h2 id="this-page-will-be-an-overview-of-things-to-know-and-understand-before-you-start-this-project" tabindex="-1">This page will be an overview of things to know and understand before you start this project <a class="header-anchor" href="#this-page-will-be-an-overview-of-things-to-know-and-understand-before-you-start-this-project" aria-hidden="true">#</a></h2><h3 id="firmware-is-not-final" tabindex="-1">Firmware is not final <a class="header-anchor" href="#firmware-is-not-final" aria-hidden="true">#</a></h3><p>Bugs can and will occur which may hinder the experience or useability at times. Do not expect 100% reliable and perfect function. Not all features are fully developed yet.</p><h3 id="firmware-may-have-user-difficulties" tabindex="-1">Firmware may have user difficulties <a class="header-anchor" href="#firmware-may-have-user-difficulties" aria-hidden="true">#</a></h3><p>Our firmware has not been tested widely so issues may creep up.</p><h3 id="documentation-may-be-incomplete" tabindex="-1">Documentation may be incomplete <a class="header-anchor" href="#documentation-may-be-incomplete" aria-hidden="true">#</a></h3><p>Important steps may be missing.</p><h3 id="some-diy-knowledge-is-required" tabindex="-1">Some DIY knowledge is required <a class="header-anchor" href="#some-diy-knowledge-is-required" aria-hidden="true">#</a></h3><p>You will need to know how to DIY and think critically to complete this project.</p><p>A good general place to start looking for information is on the <a href="https://en.wikipedia.org/wiki/Aeroponics" target="_blank" rel="noreferrer">Wikipedia aeroponics</a> page, they have a lot of good information and sources for validation and future reading.</p><h3 id="youtubers" tabindex="-1">Youtubers <a class="header-anchor" href="#youtubers" aria-hidden="true">#</a></h3><p>A great place to get started is to watch some videos on aeroponics. Here are some good ones to get you started:</p><ul><li><a href="https://www.youtube.com/channel/UC5zdi4KM3ewwfYMNo_KnU0A/featured" target="_blank" rel="noreferrer">Jeb Gardener</a></li><li><a href="https://www.youtube.com/channel/UCxJC4JRtlIoxpO-2pNGEKGw" target="_blank" rel="noreferrer">JAeroCo</a></li></ul><h3 id="papers-and-articles" tabindex="-1">Papers and articles <a class="header-anchor" href="#papers-and-articles" aria-hidden="true">#</a></h3><p><a href="https://asrjetsjournal.org/index.php/American_Scientific_Journal/article/download/2543/1028" target="_blank" rel="noreferrer">Hydroponics, Aeroponic and Aquaponic as Compared with Conventional Farming, <em>American Scientific Research Journal for Engineering, Technology, and Sciences (ASRJETS) (2017) Volume 27, No 1, pp 247-255</em></a></p><p><a href="https://www.academicjournals.org/article/article1426864985_Mobini%20et%20al.pdf" target="_blank" rel="noreferrer">The impact of aeration on potato (Solanum tuberosumL.) minituber production under soilless conditions <em>academicjournals.org (2015) Vol. 14(11), pp 910-921, 18 March</em></a></p><p><a href="https://www.academicjournals.org/article/article1379513341_Mbiyu%20et%20al.pdf" target="_blank" rel="noreferrer">Use of aeroponics technique for potato (Solanum tuberosum) minitubers production in Kenya</a></p><h3 id="once-you-have-acknowledged-the-items-above-move-on-to-the-full-build-guide" tabindex="-1">Once you have acknowledged the items above, move on to the <a href="./../how_to_build/full_build">Full Build Guide</a> <a class="header-anchor" href="#once-you-have-acknowledged-the-items-above-move-on-to-the-full-build-guide" aria-hidden="true">#</a></h3>',19),n=[r];function l(s,d,h,c,u,p){return a(),t("div",null,n)}const w=e(i,[["render",l]]);export{m as __pageData,w as default};
